function wk1_parse_rc(B,V,col){
var rel=V&0x8000;
V&=~0x8000;
V=(rel?B:0)+(V>=0x2000?V-0x4000:V);
return(rel?"":"$")+(col?encode_col(V):encode_row(V));
}
var oprec=[
8,8,8,8,8,8,8,8,6,4,4,5,5,7,3,3,
3,3,3,3,1,1,2,6,8,8,8,8,8,8,8,8];

/* TODO: flesh out */
var FuncTab={
0x33:["FALSE",0],
0x34:["TRUE",0],
0x46:["LEN",1],
0x50:["SUM",69],
0x51:["AVERAGEA",69],
0x52:["COUNTA",69],
0x53:["MINA",69],
0x54:["MAXA",69],
0x6F:["T",1]};

var BinOpTab=[
"","","","","","","","",
"","+","-","*","/","^","=","<>",
"<=",">=","<",">","","","","",
"&","","","","","","",""];


function wk1_fmla_to_csf(blob,o){
prep_blob(blob,0);
var out=[],argc=0,R="",C="";
while(blob.l<blob.length){
var cc=blob[blob.l++];
switch(cc){
case 0x00:out.push(blob.read_shift(8,'f'));break;
case 0x01:{
C=wk1_parse_rc(o[0].c,blob.read_shift(2),true);
R=wk1_parse_rc(o[0].r,blob.read_shift(2),false);
out.push(C+R);
}break;
case 0x02:{
var c=wk1_parse_rc(o[0].c,blob.read_shift(2),true);
var r=wk1_parse_rc(o[0].r,blob.read_shift(2),false);
C=wk1_parse_rc(o[0].c,blob.read_shift(2),true);
R=wk1_parse_rc(o[0].r,blob.read_shift(2),false);
out.push(c+r+":"+C+R);
}break;
case 0x03:
if(blob.l<blob.length){console.error("WK1 premature formula end");return;}
break;
case 0x04:out.push("("+out.pop()+")");break;
case 0x05:out.push(blob.read_shift(2));break;
case 0x06:{
/* TODO: text encoding */
var Z="";while(cc=blob[blob.l++]){Z+=String.fromCharCode(cc);}
out.push('"'+Z.replace(/"/g,'""')+'"');break;
}break;

case 0x08:out.push("-"+out.pop());break;
case 0x17:out.push("+"+out.pop());break;
case 0x16:out.push("NOT("+out.pop()+")");break;

case 0x14:case 0x15:{
var argR=out.pop(),argL=out.pop();
out.push(["AND","OR"][cc-0x14]+"("+argL+","+argR+")");
}break;

default:
if(cc<0x20&&BinOpTab[cc]){
argR=out.pop();argL=out.pop();
out.push(argL+BinOpTab[cc]+argR);
}else if(FuncTab[cc]){
argc=FuncTab[cc][1];
if(argc==69)argc=blob[blob.l++];
if(argc>out.length){console.error("WK1 bad formula parse 0x"+cc.toString(16)+":|"+out.join("|")+"|");return;}
var args=out.slice(-argc);
out.length-=argc;
out.push(FuncTab[cc][0]+"("+args.join(",")+")");
}else
if(cc<=0x07)return console.error("WK1 invalid opcode "+cc.toString(16));else
if(cc<=0x18)return console.error("WK1 unsupported op "+cc.toString(16));else
if(cc<=0x1E)return console.error("WK1 invalid opcode "+cc.toString(16));else
if(cc<=0x73)return console.error("WK1 unsupported function opcode "+cc.toString(16));
// possible future functions ??
else return console.error("WK1 unrecognized opcode "+cc.toString(16));}

}
if(out.length==1)o[1].f=""+out[0];else
console.error("WK1 bad formula parse |"+out.join("|")+"|");
}


