function parse_NUMBER_18(blob,length){
var o=parse_cell_3(blob,length);
o[1].v=blob.read_shift(2);
var v=o[1].v>>1;
if(o[1].v&0x1){
switch(v&0x07){
case 0:v=(v>>3)*5000;break;
case 1:v=(v>>3)*500;break;
case 2:v=(v>>3)/20;break;
case 3:v=(v>>3)/200;break;
case 4:v=(v>>3)/2000;break;
case 5:v=(v>>3)/20000;break;
case 6:v=(v>>3)/16;break;
case 7:v=(v>>3)/64;break;}

}
o[1].v=v;
return o;
}

function parse_NUMBER_17(blob,length){
var o=parse_cell_3(blob,length);
var v1=blob.read_shift(4);
var v2=blob.read_shift(4);
var e=blob.read_shift(2);
if(e==0xFFFF){
if(v1===0&&v2===0xC0000000){o[1].t="e";o[1].v=0x0F;}// ERR -> #VALUE!
else if(v1===0&&v2===0xD0000000){o[1].t="e";o[1].v=0x2A;}// NA -> #N/A
else o[1].v=0;
return o;
}
var s=e&0x8000;e=(e&0x7FFF)-16446;
o[1].v=(1-s*2)*(v2*Math.pow(2,e+32)+v1*Math.pow(2,e));
return o;
}
function write_NUMBER_17(R,C,wsidx,v){
var o=new_buf(14);
o.write_shift(2,R);
o.write_shift(1,wsidx);
o.write_shift(1,C);
if(v==0){
o.write_shift(4,0);
o.write_shift(4,0);
o.write_shift(2,0xFFFF);
return o;
}
var s=0,e=0,v1=0,v2=0;
if(v<0){s=1;v=-v;}
e=Math.log2(v)|0;
v/=Math.pow(2,e-31);
v2=v>>>0;
if((v2&0x80000000)==0){v/=2;++e;v2=v>>>0;}
v-=v2;
v2|=0x80000000;
v2>>>=0;
v*=Math.pow(2,32);
v1=v>>>0;
o.write_shift(4,v1);
o.write_shift(4,v2);
e+=0x3FFF+(s?0x8000:0);
o.write_shift(2,e);
return o;
}

