/* [MS-XLSB] 2.1.7.50 Styles */
function parse_sty_bin(data,themes,opts){
var styles={};
styles.NumberFmt=[];
for(var y in SSF._table){styles.NumberFmt[y]=SSF._table[y];}

styles.CellXf=[];
styles.Fonts=[];
var state=[];
var pass=false;
recordhopper(data,function hopper_sty(val,R_n,RT){
switch(RT){
case 0x002C:/* 'BrtFmt' */
styles.NumberFmt[val[0]]=val[1];SSF.load(val[1],val[0]);
break;
case 0x002B:/* 'BrtFont' */
styles.Fonts.push(val);
if(val.color.theme!=null&&themes&&themes.themeElements&&themes.themeElements.clrScheme){
val.color.rgb=rgb_tint(themes.themeElements.clrScheme[val.color.theme].rgb,val.color.tint||0);
}
break;
case 0x0401:/* 'BrtKnownFonts' */break;
case 0x002D:/* 'BrtFill' */
break;
case 0x002E:/* 'BrtBorder' */
break;
case 0x002F:/* 'BrtXF' */
if(state[state.length-1]=="BrtBeginCellXFs"){
styles.CellXf.push(val);
}
break;
case 0x0030:/* 'BrtStyle' */
case 0x01FB:/* 'BrtDXF' */
case 0x023C:/* 'BrtMRUColor' */
case 0x01DB:/* 'BrtIndexedColor': */
break;

case 0x0493:/* 'BrtDXF14' */
case 0x0836:/* 'BrtDXF15' */
case 0x046A:/* 'BrtSlicerStyleElement' */
case 0x0200:/* 'BrtTableStyleElement' */
case 0x082F:/* 'BrtTimelineStyleElement' */
case 0x0C00:/* 'BrtUid' */
break;

case 0x0023:/* 'BrtFRTBegin' */
pass=true;break;
case 0x0024:/* 'BrtFRTEnd' */
pass=false;break;
case 0x0025:/* 'BrtACBegin' */
state.push(R_n);pass=true;break;
case 0x0026:/* 'BrtACEnd' */
state.pop();pass=false;break;

default:
if((R_n||"").indexOf("Begin")>0)state.push(R_n);else
if((R_n||"").indexOf("End")>0)state.pop();else
if(!pass||opts.WTF&&state[state.length-1]!="BrtACBegin")throw new Error("Unexpected record "+RT+" "+R_n);}

});
return styles;
}

